import React from "react";
import { StyleSheet, Text, View } from "react-native";

export default function UserSquadElement({ squad }) {
	console.log(squad);
	return (
		<View style={styles.container}>
			<Text style={styles.title}>{squad.name}</Text>
			<Text style={styles.id}>ID: {squad.id}</Text>
			<Text style={{ marginTop: 10 }}>Description:</Text>
			<Text style={styles.description}>"{squad.description}"</Text>
			<Text style={{ marginTop: 10 }}>Participants:</Text>
			<View style={styles.participant}>
				<Text> {squad.users} </Text>
			</View>
		</View>
	);
}

const styles = StyleSheet.create({
	container: {
		paddingTop: "5%",
		height: "100%",
	},
	title: {
		width: "90%",
		fontSize: 35,
		fontWeight: "500",
	},
	id: {
		width: "90%",
		marginTop: 5,
		fontSize: 30,
		fontWeight: "400",
	},
	description: {
		width: "90%",
		marginTop: 2,
		fontSize: 20,
		fontWeight: "300",
	},
});
